var tipuesearch = {"pages": [{'title': 'About', 'text': 'stage1-bg20 \n 組員:40823213,40823232 \n 組別網站: https://40823232.github.io/stage1-bg20/content/index.html \n gitter: https://gitter.im/2020bg5/stage1-bg20 \n', 'tags': '', 'url': 'About.html'}, {'title': '各週進度', 'text': '', 'tags': '', 'url': '各週進度.html'}, {'title': 'w1', 'text': '建立網站: https://40823232.github.io/cd2021/content/index.html \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2討論主題', 'text': '題目:遊樂設施 動機:了解設施的構造，和作動的方式 第二週:繪製零件圖，並使用coppeliasim進行模擬 第三週:模擬問題討論及修改 第四週:報告 \n', 'tags': '', 'url': 'w2討論主題.html'}, {'title': 'w3模擬', 'text': '桿子裝上馬達後無法控制升降的角度，因此嘗試使用連桿機構 \n \n 因為這次主題需要用到連桿機構，故模擬pyslvs \n \n 第一次模擬，雖然物體有升降，但路徑不是我們需要的 \n \n 第二次模擬，路徑接近但滑塊會延伸過長，升降的範圍也較小 \n \n 第三次模擬，前方在下降的時候，會微微向前傾斜 \n \n 第四次模擬，讓前方升降過程較為穩定 \n', 'tags': '', 'url': 'w3模擬.html'}, {'title': 'w4報告', 'text': '小組每週報告: stage1-bg20.pdf \n 小組reveal: https://40823232.github.io/stage1-bg20/reveal/index.html#/ \n 個人報告影片: \n 小組報告影片: \n \n \n', 'tags': '', 'url': 'w4報告.html'}, {'title': '小組討論', 'text': 'gitter \n \n \n', 'tags': '', 'url': '小組討論.html'}, {'title': 'video', 'text': '建立網站影片 \n \n 利用此影片讓組員有辦法協同倉儲，並取得最新的版本 \n \n', 'tags': '', 'url': 'video.html'}, {'title': 'note', 'text': '', 'tags': '', 'url': 'note.html'}, {'title': 'zoomit', 'text': 'CTRL+1 縮放螢幕(能夠調整縮放倍率) \n Zoom 模式的時候，按下 滑鼠左鍵 可以啟動「 Draw 模式」 \n 退出 Zoom 模式，可以按 滑鼠右鍵 ，或者是 ESC \n \n CTRL+2 進入 DRAW 模式(非縮放模式) \n CTRL+Z (退回上一步) \n 隨意形狀 \xa0 - 直接壓住 滑鼠左鍵 然後滑鼠移動想要的線條。 \n 直線 \xa0- 壓住 SHIFT 然後 滑鼠左鍵 然後話要的線條。 \n 方塊 \xa0- 壓住 CTRL 然後 滑鼠左鍵 畫出方塊。 \n 圓圈 \xa0- 壓住 TAB 然後 滑鼠左鍵 畫出圓圈。 \n 箭頭 \xa0 - 壓住 CTRL+SHIFT 然後 滑鼠左鍵 畫出有箭頭的線。 \n 按住 T 能夠打字(英文) \n \n', 'tags': '', 'url': 'zoomit.html'}, {'title': 'pelican.leo', 'text': 'ctrl+i新增一頁 \n ctrl+u往上移動 \n ctrl+d往下移動 \n ctrl+r往右移動 \n ctrl+l往左移動 \n 點兩下變更名稱 \n \n 編輯完成後，先save之後在local-blog按右鍵，再按goto script \n \n 在黑窗執行這段文字後，就能到8444查看 \n \n github-blog是直接推送到遠端(要在cd2021的倉儲提交) \n \n 執行完畢後，add,commit,push \n', 'tags': '', 'url': 'pelican.leo.html'}, {'title': 'coppeliasim', 'text': '\n 如果要讓零件碰撞要開啟respondable，上排表示同個基準的零件碰撞，下排是任何基準的零件碰撞 \n 要讓零件動就要開啟dynamic \n \n 如果要將物件隱藏要把camera visibility layers給取消 \n \n 這是將組合圖拆解，方便對各零件操作 \n \n \n 要將兩物體綁在一起時，要按apply to selection(旋轉和移動) \n', 'tags': '', 'url': 'coppeliasim.html'}, {'title': 'W5', 'text': '', 'tags': '', 'url': 'W5.html'}]};